import { Outlet } from 'react-router-dom';
import SearchPage from '../components/SearchPage';
const Home = () => {
  return (
    <>
    <Searchbar />
    <div>
      <h3 className='section-heading'>Search store near you</h3>
    </div> 
    <SearchPage/>
    {/* </div> */}
    </>
      
  )
}

export default Home;
